// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract BlockchainPassport {
    address public admin; // 默認為第0個地址的管理者

    struct PassportInfo {
        string holderName; // 持有者姓名
        string nationality; // 國籍
        uint256 birthDate; // 出生日期
        uint256 issueDate; // 發行日期
        uint256 expiryDate; // 到期日期
        bool isValid; // 狀態（1:有效, 0:無效）
    }

    mapping(string => PassportInfo) private passports; // 護照ID對應的基本資料

    event PassportIssued(string passportID, string holderName); // 發行護照時觸發
    event PassportStatusUpdated(string passportID, bool newStatus); // 狀態更新時觸發

    constructor() {
        admin = msg.sender; // 默認合約部署者為管理者
    }

    modifier onlyIssuer() {
        require(msg.sender == admin, "Only the admin can perform this action");
        _;
    }

    // **需求2**：發行護照
    function issuePassport(
        string memory passportID,
        string memory holderName,
        string memory nationality,
        uint256 birthDate,
        uint256 issueDate,
        uint256 expiryDate,
        bool isValid
    ) public payable onlyIssuer {
        require(msg.value > 0, "Transaction requires ETH"); // 每次操作需扣除ETH
        require(bytes(passports[passportID].holderName).length == 0, "Passport ID already exists");

        passports[passportID] = PassportInfo({
            holderName: holderName,
            nationality: nationality,
            birthDate: birthDate,
            issueDate: issueDate,
            expiryDate: expiryDate,
            isValid: isValid
        });

        emit PassportIssued(passportID, holderName); // 觸發發行事件
    }

    // **需求3**：查詢護照資料
    function getPassport(string memory passportID) public view returns (
        string memory holderName,
        string memory nationality,
        uint256 birthDate,
        uint256 issueDate,
        uint256 expiryDate,
        bool isValid
    ) {
        require(bytes(passports[passportID].holderName).length != 0, "Passport ID does not exist");

        PassportInfo memory passport = passports[passportID];
        return (
            passport.holderName,
            passport.nationality,
            passport.birthDate,
            passport.issueDate,
            passport.expiryDate,
            passport.isValid
        );
    }

    // **需求4**：更改護照狀態
    function updatePassportStatus(string memory passportID, bool newStatus) public payable onlyIssuer {
        require(msg.value > 0, "Transaction requires ETH"); // 每次操作需扣除ETH
        require(bytes(passports[passportID].holderName).length != 0, "Passport ID does not exist");

        passports[passportID].isValid = newStatus; // 更新狀態
        emit PassportStatusUpdated(passportID, newStatus); // 觸發狀態更新事件
    }
}

